import { useNavigate } from "react-router-dom";
import { LoginMenuButton } from "../../styles/Buttons";
import { SerifText } from "../../styles/TextStyles";
import { chooseIcon } from "../functions/getIcon";

export const MenuButton = ({ label, img, nav, onClick }: any) => {
  const navigate = useNavigate();
  return (
    <LoginMenuButton onClick={() => (nav ? navigate(`/${nav}`) : onClick())}>
      <div
        style={{
          flex: 1,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        {chooseIcon(img, "")}
      </div>
      <div
        style={{
          flex: 6,
          display: "flex",
          alignItems: "center",
          marginLeft: "10px",
        }}
      >
        <SerifText>{label}</SerifText>
      </div>
      {img === "languages" ? (
        <>
          <MenuButton
            img={"xD"}
            label={"Language"}
            onClick={() => console.log("x")}
          />
        </>
      ) : null}
    </LoginMenuButton>
  );
};
